import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import CreateArea from "./CreateArea";

const noteList=[{title:"Note1",content:"Note1 content"},{title:"Note2",content:"Note2 content"},{title:"Note3",content:"Note3 content"}];

function App() {
  return (
    <div>
      <Header />
      <CreateArea />
      <Note key={1} title="Note title" content="Note content" noteList={noteList} />
      <Footer />
    </div>
  );
}

export default App;
